import React from 'react';
import ClientHeader from './ClientHeader';
import ClientSidebar from './ClientSidebar';

function ClientAccount() {
    return (
        <div className='container'>
            <ClientHeader />
            <ClientSidebar />
            <div className="home-bar">
                <ul>
                    <li>Plans</li>
                    <li>Account</li>
                    <li>Company</li>
                    <li>Payments</li>
                    <li>Notification</li>
                </ul>
            </div>
        </div>
    );
}

export default ClientAccount;
